import ReactDOM from 'react-dom/client';

import './index.css';
import {App} from './App';
import {Test} from './App';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<App />);

const test = ReactDom.createRoot(document.getElementById('test'));
test.render(<Test />);
